import React from 'react'
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom'
import { connect } from 'react-redux';


function Navigation(props){
    return (
        <Grid item xs={12} container styles={{width: '100%', 'align-self': 'end'}} justify="center" >

            {
                props.prev 
                    && 
                <Link to={props.prev} style={{margin: '1%'}}>
                    <Button variant="outlined" color="primary" size="large" style={{width: '100px'}}>
                        PREVIOUS    
                    </Button>
                 </Link>    
            }          

            {
                props.next
                  &&
                <Link to={props.next} style={{margin: '1%'}}>
                  <Button 
                      variant="outlined" 
                      color="primary" 
                      size="large" 
                      style={{width: '100px'}}
                      onClick={() => {
                          console.log(props);
                          return props.action && props.dispatch(props.action);
                          }}>
                          NEXT  
                  </Button>
              </Link>  
            }    
        </Grid>
    )
}

function mapStateToProps(state){
    return state;
}

export default connect(mapStateToProps)(Navigation);
